export default function Profile(){
    return (
        <div className="profile-container">
            <header>
                <img src={logoImg} alt="Be The Hero" />
                <span>Bem Vinda, APAD</span>


                <Link  className="button" to="/incidents/new"> </Link>
                <button type="">
                    <FiPower size={18} color="#E02041"></FiPower>
                </button>
            </header>
        </div>
    );
}
